import { Box, Flex, Stack } from "@chakra-ui/react"


function Signup(){

    return (
        <div>
            <Stack width="90%" margin="auto">
                <Flex width="100%" margin="auto">
                    <Box border="solid 1px red" width="50" height="600px" margin="auto">

                    </Box>

                    {/* <Box border="solid 1px green" width="50%" height="600px" margin="auto">

                    </Box> */}
                </Flex>
            </Stack>
        </div>
    )
}

export default Signup
